DROP TABLE IF EXISTS `items`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `items` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `item_id` mediumint unsigned NOT NULL DEFAULT '0',
  `expansion_id` bigint unsigned DEFAULT NULL,
  `name` varchar(255) NOT NULL DEFAULT '',
  `weight` float(3,2) unsigned DEFAULT NULL,
  `quality` tinyint unsigned NOT NULL DEFAULT '0',
  `display_id` mediumint unsigned NOT NULL DEFAULT '0',
  `inventory_type` tinyint unsigned NOT NULL DEFAULT '0',
  `allowable_class` mediumint NOT NULL DEFAULT '-1',
  `item_level` tinyint unsigned NOT NULL DEFAULT '0',
  `required_level` tinyint unsigned NOT NULL DEFAULT '0',
  `set_id` mediumint unsigned NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `items_item_id_expansion_id_unique` (`item_id`,`expansion_id`),
  KEY `items_id` (`item_id`),
  KEY `items_name` (`name`),
  KEY `items_expansion_id_index` (`expansion_id`),
  KEY `items_item_id_index` (`item_id`),
  CONSTRAINT `items_expansion_id_foreign` FOREIGN KEY (`expansion_id`) REFERENCES `expansions` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=37916 DEFAULT CHARSET=utf8 COMMENT='Item System';
